import React from "react";
import { Input } from "@chakra-ui/react";

const Studentreg = () => {
  return (
    <div className=" w-1/2 rounded-lg bg-gray-200 ">
      <div className="h-64  border-black border-0 pt-3 ">
        <div>
          <h1 className="border-1 border-black text-lg justify-center">
            Register Student
          </h1>
        </div>
      </div>
    </div>
  );
};

export default Studentreg;
